class SolutionTruth:
    def _helper(self,word_set,word,curr,res):
        if curr != word and curr in word_set:
            res.append(word)
            return True

        for i in range(len(curr)+1):
            if curr[:i] in word_set and curr[:i] != word:
                if self._helper(word_set,word,curr[i:],res):
                    return True 
        return False

    def findAllConcatenatedWordsInADict(self, words: List[str]) -> List[str]:
        word_set = set(words)
        res = []
        for word in words:
            self._helper(word_set,word,word,res)
        return res


class SolutionTest:
    def _helper(self,word_set,memo,word):
        # print(f"curr:{curr}")
        if word in memo:
            return memo[word]

        memo[word]=False
        for i in range(1,len(word)):
            prefix = word[:i]
            suffix = word[i:]
            if prefix in word_set and suffix in word_set:
                memo[word]=True
                break
            if prefix in word_set and self._helper(word_set,memo,suffix):
                memo[word]=True
                break
            if self._helper(word_set,memo,prefix) and suffix in word_set:
                memo[word]=True
                break
        return memo[word]

    def findAllConcatenatedWordsInADict(self, words: List[str]) -> List[str]:
        word_set = set(words)
        res = []
        memo = {}
        for word in words:
            if self._helper(word_set,memo,word):
                res.append(word)
        return res

